function hasClass(n,t){return(" "+n.className+" ").indexOf(" "+t+" ")>-1}function bindDynamicNumbers(){$(".dynamic-number").each(function(){var n=$(this).text(),t=$(this).data("dnumber"),i=$(this);$({numberValue:n}).animate({numberValue:t},{duration:4e3,easing:"swing",step:function(){$(i).text(Math.ceil(this.numberValue))}})})}function GetPage(n,t){$.get(n,function(n){$(t).html(n)})}function ActivateNavigation(n){$(".main-nav , .user-nav ").find(n).addClass("current-menu-item")}window.dynamicNumbersBound=!1;var wow=new WOW;WOW.prototype.show=function(n){return wow.applyStyle(n),typeof n.parentNode!="undefined"&&hasClass(n.parentNode,"dynamic-numbers")&&!window.dynamicNumbersBound&&(bindDynamicNumbers(),window.dynamicNumbersBound=!0),n.className=""+n.className+" "+wow.config.animateClass};wow.init();$(function(){$("#backTop").backTop({position:400,speed:500,color:"red"});$("img").on("contextmenu",function(){return!1})});